import React from "react";

function LoginPage() {
  return (
    <div className="login-page">
      <h1>Connexion / Inscription</h1>
      <p>Connectez-vous pour accéder à votre tableau de bord ou créez un compte.</p>
    </div>
  );
}

export default LoginPage;
